import { useState, useEffect } from 'react';

function Na() {
  const [loginTime, setLoginTime] = useState(null);
  const [elapsedTime, setElapsedTime] = useState(0);

  useEffect(() => {
    const timestamp = new Date().getTime();
    setLoginTime(timestamp);

    const intervalId = setInterval(() => {
      setElapsedTime(new Date().getTime() - timestamp);
    }, 1000);

    return () => {
      clearInterval(intervalId);
    };
  }, []);

  const handleLogout = () => {
    setLoginTime(null);
    setElapsedTime(0);
    // handle logout logic here
  };

  if (!loginTime) {
    return (
      <div>
        <button onClick={() => setLoginTime(new Date().getTime())}>
          Log in
        </button>
      </div>
    );
  }

  const loginDate = new Date(loginTime).toLocaleDateString();
  const loginTimeStr = new Date(loginTime).toLocaleTimeString();
  const elapsedSeconds = Math.floor(elapsedTime / 1000);

  return (
    <div>
      <div>
        Logged in at {loginTimeStr} on {loginDate}
      </div>
      <div>
        Elapsed time: {elapsedSeconds} seconds
      </div>
      <button onClick={handleLogout}>
        Log out
      </button>
    </div>
  );
}
